import React, { useEffect, useState } from "react";
import axios from "axios";
import { useAuth } from "../user/AuthUserContext";
import NavBar from "../components/Navabar";
import { GETP } from "../components/config";

const ReadPost = () => {
  const { userData } = useAuth();
  const idUser = userData.id_User;
  //const autor=userData.st_NombreUser;

  const [data, setData] = useState([]);

  const URL = GETP+`${idUser}`;

  const loadData = async () => {
    const response = await axios.get(URL);
    setData(response.data);
    console.log(response.data);
  };
  useEffect(() => {
    loadData();
  }, []);

  return (
    <div className="container-fluid">
    <NavBar />
    <div className="row">
      <div className="col-md-12">
        <h1 className="text-center">Mis Posts</h1>
        <div className="row">
          {data.map((item, index) => (
            <div className="col-md-6 mb-3" key={index}>
              <div className="card">
                <div className="card-body cardhome">
                  <h3 className="card-title">{item.st_Titulo}</h3>
                  <p className="card-text">{item.st_Contenido}</p>
                  <h6>Publicado:{item.dt_Fecha}</h6>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <div className="col-md-6">
        {/* Agrega contenido adicional en la columna derecha si es necesario */}
      </div>
    </div>
  </div>

  );
};

export default ReadPost;
